import React from "react"
import News from './News.js'
import { connect } from 'react-redux'

class NewsContainer extends React.Component{
    render(){
        return(
            <div> 
            {this.props.articles.map(article=>
                <News 
                key={article.id} 
                article={article}/>)}
            </div>
        )
    }
}



export default NewsContainer
